import re
regex = '^([0-1][0-9]):([0-5][0-9])\\s(AM|PM)$'

class Time:

    def __init__(self, timestring):
        r = re.findall(regex, timestring)[0]
        (h, m) = map(int, r[:2])
        h %= 12
        h += 12 if r[2] == 'PM' else 0
        self.t = h * 60 + m

    def __le__(self, other):
        return self.t <= other.t

    def __ge__(self, other):
        return self.t >= other.t

